// Calculator.js
import React, { useState } from "react";
import Layout from "./Layout";

const Calculator = () => {
  // Состояния для ввода данных
  const [district, setDistrict] = useState("");
  const [rooms, setRooms] = useState(1);
  const [totalArea, setTotalArea] = useState(0);
  const [constructionYear, setConstructionYear] = useState(2000);
  const [buildingFloors, setBuildingFloors] = useState(1);
  const [userAge, setUserAge] = useState(30);
  const [result, setResult] = useState(null);

  // Функция для отправки данных на сервер
  const calculateRent = async () => {
    const response = await fetch("http://localhost:3000/cost/calculate", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        district,
        rooms,
        totalArea,
        constructionYear,
        buildingFloors,
        userAge,
      }),
    });

    const data = await response.json();
    setResult(data);
  };

  return (
    <Layout>
      <main className="container mx-auto py-12 px-6">
        <h2 className="text-2xl md:text-4xl font-bold mb-6 text-center">Калькулятор ренты</h2>

        <div className="max-w-4xl mx-auto bg-white shadow-lg rounded-lg p-8">
          <h3 className="text-xl font-bold mb-4">Введите данные для расчета</h3>

          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <div className="mb-4">
              <label className="block text-sm font-medium text-gray-700">Район:</label>
              <input 
                type="string" 
                value={district} 
                onChange={(e) => setDistrict(e.target.value)} 
                className="mt-1 block w-full border border-gray-300 rounded-md p-2"
              />
            </div>
            <div className="mb-4">
              <label className="block text-sm font-medium text-gray-700">Количество комнат:</label>
              <input 
                type="integer" 
                value={rooms} 
                onChange={(e) => setRooms(e.target.value)} 
                min="1" 
                className="mt-1 block w-full border border-gray-300 rounded-md p-2"
              />
            </div>
            <div className="mb-4">
              <label className="block text-sm font-medium text-gray-700">Общая площадь (кв. м):</label>
              <input 
                type="number" 
                value={totalArea} 
                onChange={(e) => setTotalArea(e.target.value)} 
                min="1" 
                className="mt-1 block w-full border border-gray-300 rounded-md p-2"
              />
            </div>
            <div className="mb-4">
              <label className="block text-sm font-medium text-gray-700">Год постройки:</label>
              <input 
                type="integer" 
                value={constructionYear} 
                onChange={(e) => setConstructionYear(e.target.value)} 
                className="mt-1 block w-full border border-gray-300 rounded-md p-2"
              />
            </div>
            <div className="mb-4">
              <label className="block text-sm font-medium text-gray-700">Этажность здания:</label>
              <input 
                type="integer" 
                value={buildingFloors} 
                onChange={(e) => setBuildingFloors(e.target.value)} 
                min="1" 
                className="mt-1 block w-full border border-gray-300 rounded-md p-2"
              />
            </div>
            <div className="mb-4">
              <label className="block text-sm font-medium text-gray-700">Возраст пользователя:</label>
              <input 
                type="integer" 
                value={userAge} 
                onChange={(e) => setUserAge(e.target.value)} 
                min="1" 
                className="mt-1 block w-full border border-gray-300 rounded-md p-2"
              />
            </div>
          </div>

          <button 
            onClick={calculateRent} 
            className="mt-4 bg-blue-500 text-white p-2 rounded hover:bg-blue-600 transition duration-200"
          >
            Рассчитать
          </button>

          {result && (
            <div className="mt-6 bg-gray-100 p-4 rounded-lg">
              <h3 className="text-lg font-bold">Результаты:</h3>
              <p>Единовременный платеж: <span className="font-semibold">{result.oneTimePayment}</span></p>
              <p>Ежемесячный платеж: <span className="font-semibold">{result.monthlyPayment}</span></p>
            </div>
          )}
        </div>
      </main>
    </Layout>
  );
};

export default Calculator;
